import React from 'react';
import { Box, Heading } from 'native-base';
import Colors from '../color';

function Review() {
  return (
    <Box my={9}>
        <Heading bold fontSize={15} mb={2}>
            Review
        </Heading>
        {/* IF NO REVIEW */}

        {/* REVIEW */}
        <Box p={3} bg={Colors.deepestGray} mt={5} rounded={5}>
            <Heading></Heading>
        </Box>
    </Box>
  );
}

export default Review;
